import React from "react";
import "../style/navbar.css";
function Navbar() {
  return (
    <div className="navbar">
      <h1>Portfolio</h1>
      <div className="linkseaction">
        <button>Home</button>
        <button> About</button>
        <button> Project</button>
        <button> Contact</button>

        <p>home</p>
        <p>about</p>
        <p>project</p>
        <p>contact</p>
      </div>
    </div>
  );
}

export default Navbar;
